import Banner from '../../components/Banner/banner';
import './about.css';
import imgBanner from '../../assets/banner-about.png'
const textBanner = "about"



// Page à propos > Contient une bannière et renseignements sur Kasa
function About() {
   return (
      <section className='aboutContainer'>
         <Banner picture={imgBanner} texte={textBanner}/>
         <p>Page à propos contient une bannière et renseignements</p>
      </section>
   )
 }
 
 export default About
